  private static String decrypt(String string) {
    StringBuilder stringBuilder = new StringBuilder();
    int n = 0;
    while (n < string.length()) {
      stringBuilder.append((char)(string.charAt(n) ^ 0x614)); // Dynamic - key
      ++n;
    }
    return stringBuilder.toString();
  }
